import React, { Component } from 'react'
import LinkedIn from "./LinkedIn.png"

class Contact extends Component {
    render () {
        return (
            <div>
                <h1>Contact</h1>
                <p>I can always be reached on my LinkedIn !</p>
                <img src={LinkedIn} className="MyImage"></img>
            </div>
        )
    }
}

export default Contact;
